import React, {useEffect, useState} from "react";
import Grid from "@mui/material/Grid";
import Box from "@mui/material/Box";
import FrontPage from "./pages/FrontPage";
import Header from "./components/Header";
import { Routes, Route } from "react-router-dom";
import { BrowserRouter } from "react-router-dom";
import LoginPage from "./components/LoginPage";
import ProtectedRoute from "./components/ProtectedRoute"

function App() {
  const [isAuth, setIsAuth] = useState(false);
  useEffect(() => {
    //Todo- call auth API, set Return to setIsAuth
    setIsAuth(true)
  } , [])
  return (
    <BrowserRouter>
      <Box>
        <Header />
        <Routes>
          <Route
            path="/"
            element={
              <Grid container>
                <FrontPage type="vacations"/>
              </Grid>
            }
          />
          <Route path='/login' element={<LoginPage type='login' />} /> 
          <Route path='/signup' element={<LoginPage type='signup' />} /> 

          <Route path='spots' element={<FrontPage type='' />} />
          {/* Check if logged in, implement protected routes here. */}

          <Route
            path="home"
            element={
              <ProtectedRoute isAuth={isAuth}>
          <Route path='userFavorites' element={<FrontPage type='userFavorites' />} />
              </ProtectedRoute>
          }
        />
        </Routes>
      </Box>
    </BrowserRouter>
  );
}

export default App;
